sys_variable_value.value:
(function execute(inputs, outputs) {
  //outputs = new GCloudErrorHandler().genericErrorHandler(inputs, outputs);
  gs.info(inputs.response_body);
  var response = JSON.parse(inputs.response_body);
  var textAnnotations = [];

   outputs.transcript = response.responses[0].fullTextAnnotation.text;
  for (i = 0; i < response.responses[0].textAnnotations.length; i++){
    var textAnnotation = {"description":response.responses[0].textAnnotations[i].description}
    gs.info(textAnnotation);

    textAnnotations[i] = textAnnotation;
  }

  outputs.textannotations = textAnnotations;
})(inputs, outputs);

